package en.bible;

public class enbible57 {

public enbible57() {

putmapbible57();

}

private void putmapbible57() {

ensuperobject.biblemap.put("b57_1_1", new ensuperobject(57,1,1,"Paul, a prisoner of Jesus Christ, and Timothy our brother, unto Philemon our dearly beloved, and fellowlabourer,"));
ensuperobject.biblemap.put("b57_1_2", new ensuperobject(57,1,2,"And to our beloved Apphia, and Archippus our fellowsoldier, and to the church in thy house:"));
ensuperobject.biblemap.put("b57_1_3", new ensuperobject(57,1,3,"Grace to you, and peace, from God our Father and the Lord Jesus Christ."));
ensuperobject.biblemap.put("b57_1_4", new ensuperobject(57,1,4,"I thank my God, making mention of thee always in my prayers,"));
ensuperobject.biblemap.put("b57_1_5", new ensuperobject(57,1,5,"Hearing of thy love and faith, which thou hast toward the Lord Jesus, and toward all saints;"));
ensuperobject.biblemap.put("b57_1_6", new ensuperobject(57,1,6,"That the communication of thy faith may become effectual by the acknowledging of every good thing which is in you in Christ Jesus."));
ensuperobject.biblemap.put("b57_1_7", new ensuperobject(57,1,7,"For we have great joy and consolation in thy love, because the bowels of the saints are refreshed by thee, brother."));
ensuperobject.biblemap.put("b57_1_8", new ensuperobject(57,1,8,"Wherefore, though I might be much bold in Christ to enjoin thee that which is convenient,"));
ensuperobject.biblemap.put("b57_1_9", new ensuperobject(57,1,9,"Yet for love's sake I rather beseech thee, being such an one as Paul the aged, and now also a prisoner of Jesus Christ."));
ensuperobject.biblemap.put("b57_1_10", new ensuperobject(57,1,10,"I beseech thee for my son Onesimus, whom I have begotten in my bonds:"));
ensuperobject.biblemap.put("b57_1_11", new ensuperobject(57,1,11,"Which in time past was to thee unprofitable, but now profitable to thee and to me:"));
ensuperobject.biblemap.put("b57_1_12", new ensuperobject(57,1,12,"Whom I have sent again: thou therefore receive him, that is, mine own bowels:"));
ensuperobject.biblemap.put("b57_1_13", new ensuperobject(57,1,13,"Whom I would have retained with me, that in thy stead he might have ministered unto me in the bonds of the gospel:"));
ensuperobject.biblemap.put("b57_1_14", new ensuperobject(57,1,14,"But without thy mind would I do nothing; that thy benefit should not be as it were of necessity, but willingly."));
ensuperobject.biblemap.put("b57_1_15", new ensuperobject(57,1,15,"For perhaps he therefore departed for a season, that thou shouldest receive him for ever;"));
ensuperobject.biblemap.put("b57_1_16", new ensuperobject(57,1,16,"Not now as a servant, but above a servant, a brother beloved, specially to me, but how much more unto thee, both in the flesh, and in the Lord?"));
ensuperobject.biblemap.put("b57_1_17", new ensuperobject(57,1,17,"If thou count me therefore a partner, receive him as myself."));
ensuperobject.biblemap.put("b57_1_18", new ensuperobject(57,1,18,"If he hath wronged thee, or oweth thee ought, put that on mine account;"));
ensuperobject.biblemap.put("b57_1_19", new ensuperobject(57,1,19,"I Paul have written it with mine own hand, I will repay it: albeit I do not say to thee how thou owest unto me even thine own self besides."));
ensuperobject.biblemap.put("b57_1_20", new ensuperobject(57,1,20,"Yea, brother, let me have joy of thee in the Lord: refresh my bowels in the Lord."));
ensuperobject.biblemap.put("b57_1_21", new ensuperobject(57,1,21,"Having confidence in thy obedience I wrote unto thee, knowing that thou wilt also do more than I say."));
ensuperobject.biblemap.put("b57_1_22", new ensuperobject(57,1,22,"But withal prepare me also a lodging: for I trust that through your prayers I shall be given unto you."));
ensuperobject.biblemap.put("b57_1_23", new ensuperobject(57,1,23,"There salute thee Epaphras, my fellowprisoner in Christ Jesus;"));
ensuperobject.biblemap.put("b57_1_24", new ensuperobject(57,1,24,"Marcus, Aristarchus, Demas, Lucas, my fellowlabourers."));
ensuperobject.biblemap.put("b57_1_25", new ensuperobject(57,1,25,"The grace of our Lord Jesus Christ be with your spirit. Amen."));

}

}